import React from 'react'
import TextField from '@material-ui/core/TextField';
function Login() {
    return (
        <div className='loginContainer'>
            <form>
                <h2>Welcome To Login Page!</h2>

                <TextField
                    // id="outlined-secondary"
                    label="Outlined secondary"
                    variant="outlined"
                    color="secondary"
                />
            </form>

        </div>
    )
}

export default Login
